import React from 'react';
import logo from '../logo.svg';

function Header(props) {
    const [user, setUser ]= useState ();
    return (
        <div>
            <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
                <div className="container-fluid">
                    <div className="navbar-brand" href="#">
                        <img src={logo} alt="Logo" width="30" height="24" className="d-inline-block align-text-top mb-1" />
                        MOOC React
                    </div>
                    <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        <li className="nav-item">
                            <div className="nav-link active" aria-current="page" href="#">Home</div>
                        </li>
                        <li className="nav-item">
                            <div className="nav-link" href="#">Link</div>
                        </li>
                    </ul>
                    <div className="navbar-text">Bonjour {user}!</div>
                </div>
            </nav>
        </div>
    );
}

export default Header;
